import React from 'react'
import { Link } from 'react-scroll'
import CV from './AnkitBansal_CV.pdf';

const Navbar = () => (

    <header className="sans-serif">
        <div className="" style={{ backgroundColor: 'rgba(40, 40, 40, 0.6)' }} >
            <div className="  " >
                <nav className="dt w-100 mw8 center">
                    <div className="dtc v-mid tr pa3">
                        <Link
                            activeClass="active"
                            to="about"
                            spy={true}
                            smooth={true}
                            offset={0}
                            duration={500}
                            className="f4 grow fw4 hover-orange no-underline white-70 dn dib-ns pv2 ph3" >About
                        </Link>
                        <Link
                            activeClass="active"
                            to="projects"
                            spy={true}
                            smooth={true}
                            offset={0}
                            duration={600}
                            className="f4 fw4 grow hover-orange no-underline white-70 dn dib-ns pv2 ph3"><a>Project</a>
                        </Link>
                        <a href={CV} target='_blank' className="f4 fw4 grow hover-orange no-underline white-70 dn dib-ns pv2 ph3" >
                          Resume
                        </a>
                        <Link
                            activeClass="active"
                            to="contact"
                            spy={true}
                            smooth={true}
                            offset={0}
                            duration={1000}
                            className="f4 fw4 grow  hover-orange no-underline white-70 dn dib-ns pv2 ph3" >Contact
                        </Link>
                    </div>
                </nav>
            </div>
        </div>
    </header>
);


export default Navbar;
